import React from 'react';
import './pages/App.css';

function Sidebar() {
  return (
    <div className="sidebar-container">
    <div className="sidebar colored">
      <ul>
        <li>Dashboard</li>
        <li>Relatórios</li>
        <li>Despesas</li>
        <li>Investimentos</li>
        <li>Cartões</li>
        <li>Metas</li>
        <li>Editar Perfil</li>
        <li>Informações</li>
      </ul>
    </div>
    </div>
  );
}

export default Sidebar;
